Aunque reconozco que se trata de un fragmento de un poema antiguo, probablemente medieval o renacentista español, no puedo identificar con certeza su continuación exacta. El texto parece estar escrito en un castellano antiguo, con algunas particularidades ortográficas como "çierta" y "nuze", lo que sugiere un texto de los siglos XV o XVI. Sin embargo, no puedo completar el poema con precisión.
